  <link href="https://fonts.googleapis.com/css?family=Inconsolata" rel="stylesheet"/>
  <style>
   body {
            				width: 21cm;
            				background-color: white;
            				font-family: 'Inconsolata', monospace;
            				font-size: 14pt;
            				font-weight:400;
            			}

            			@media print {
            				body {
            					width: 21cm;
            					/* height: 29.7cm; */

            				}
            			}
                        @media print {
                            html, body {
                                height: 99%;
                            }
                        }
            			.uline {
            				text-decoration: underline;
            			}

            			.own-detail-wrap {
            				margin: 0 0 2.5mm 10mm;
            			}
            			.own-detail {
            				padding: 2mm;
            			}
            			table {
            				border-collapse: collapse;
            				border-spacing: 0;
            				empty-cells: show;
            			}

            			tr {
            				display: table-row;
            				vertical-align: inherit;
            				border-color: inherit;
            				line-height:2mm;
            			}
            			td, th {
            				vertical-align: top;
            				font-size: 12pt;
            			}
            			.tbl-cell-root,.tbl-cell-head,.tbl-cell,.tbl-cell-hide {
            				line-height:0mm;
            				text-align: center;
            			}
            			.tbl-cell-root,.tbl-cell-hide {
            				width: 0.6in;
            			}
            			.tbl-cell-head,.tbl-cell {
            				width:1.849575in;
            			}
            			.tbl-cell-root,.tbl-cell-head,.tbl-cell {
            				border-left-width: 0.06cm;
            				border-left-style: solid;
            				border-left-color: #000000;
            				border-right-style: none;
            				border-top-width: 0.06cm;
            				border-top-style: solid;
            				border-top-color: #000000;
            				border-bottom-width: 0.06cm;
            				border-bottom-style: solid;
            				border-bottom-color: #000000;
            			}
            			.tbl-cell {
            				border-bottom-color: #c7c7c7;
            				/* line-height: 7.1mm; */
            			}
            			.tbl-cell-foot {
            				border-bottom-color: #000000;
            			}

            			.tbl-cell-fill {
            				background-color: #000000;
            				color: #ffffff;
            			}
            			.tbl-detail {
            				display: inline;
            				border-left-width: 0.06cm;
            				border-left-style: solid;
            				border-left-color: #000000;
            				border-top-width: 0.06cm;
            				border-top-style: solid;
            				border-top-color: #000000;
            				border-right-width: 0.06cm;
            				border-right-style: solid;
            				border-right-color: #000000;
            				width: 0.6in;
            				padding: 0.02in;
            			}

            			.hide{
            				display:none;
            			}
            			.tbl-cell-head {
            				/* font-size: 18pt; */
            			}
            			.tbl-row-last {
            				border-right-width: 0.06cm;
            				border-right-style: solid;
            				border-right-color: #000000;
            			}
                        .tbl-cell-head.tbl-cell-fill:not(:nth-child(2)) {
                            border-left-color: #ffffff;
                        }
  </style>
